import React, { Component } from 'react';
import './dashboard.css';

export default class Dashboard extends React.Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <table id="customers">
                <tr>
                    <th>Company</th>
                    <th>Contact</th>
                    <th>Country</th>
                </tr>
                <tr>
                    <td>Alfreds Futterkiste</td>
                    <td>Maria Anders</td>
                    <td>Germany</td>
                </tr>
            </table>);
    }
}
